import React from 'react';

class AddUserInfor extends React.Component {
    state = {
        name:"tri",
        age:20
    }
    handleClick () {
        if (this.state.name=="tri") {
            this.setState ({
                name:"quan"
            })
        }
        else {
            this.setState ({
                name:"tri"
            })
        }
    }
    handleOnchangeInput(event) {
        this.setState({
            name: event.target.value
        })
    }
    handleOnsubmit(event) {
        event.preventDefault();
        alert("hello")
    }
    render() {
        return (
            <div>
                <form onSubmit={(event) => this.props.handleAddNewUser(event,{name:"d",age:18})}>
                    Nhập tên<input type="text"/>
                    Nhập tuổi<input type="text"/>
                    <button>Submit</button>
                </form>
            </div>
        );
    }
}
export default AddUserInfor;
